    {
        '$search': {
            'index': 'search-index', 
            'text': {
                'query': searchTerm, 
                'path': 'name'
            }
        }
    }, {
        '$project': {
            'active': {
                '$filter': {
                    'cond': {
                        '$ne': [
                            '$active', false
                        ]
                    }
                }
            }, 
            'createdAt': 1, 
            'email': 1, 
            'id': 1, 
            'avatar': 1, 
            'name': 1, 
            'username': 1, 
        }
    }, {
        '$sort': {
            'createdAt': -1
        }
    }, {
        '$skip': skip
    }, {
        '$limit': limit
    }
])
</code></pre>
<p>I have tried a lot of variations of the above, with no success. Any help is much appreciated! Cheers, Raymond.</p>

