Combining lombok @AllArgsConstructor with Spring-boot MongoDb @PersistenceConstructor<p>I have a spring-boot application which uses a mongoDb database to store objects. One of the objects is ExampleDoc as below:</p>
<pre><code>package com.example;

import org.springframework.data.annotation.Id;
import org.springframework.data.annotation.PersistenceConstructor;
import org.springframework.data.mongodb.core.index.Indexed;
import org.springframework.data.mongodb.core.mapping.Document;

import lombok.Getter;
import lombok.NonNull;
import lombok.Setter;
import lombok.ToString;

import org.bson.types.ObjectId;


@ToString
@Document
public class ExampleDoc {

    @PersistenceConstructor
    public ExmapleDoc(ObjectId id, 
            String uniqueField,
            String field1,
            String field2) {
        this.id = id;
        this.uniqueField = uniqueField;
        this.field1 = field1;
        this.field2 = field2;
    }


    public ExmapleDoc() {}

    @Id
    @Getter @Setter @NonNull private ObjectId id;
    @Indexed(unique = true)
    @Getter @Setter @NonNull private String uniqueField;
    @Getter @Setter String field1
    @Getter @Setter String field2
}
</code></pre>
<p>I am using lombok to instantiate the fields along with their getters and setters. There are currently 2 constructors, one which takes all fields as args and another which takes no args. The second which takes no args is used when the application constructs an object outside of the database. Any relevant fields are set and then the doc is loaded, e.g.:</p>
<pre><code>ExampleDoc exampleDoc = new ExampleDoc();
exampleDoc.setUniqueField(&quot;uniqueVal&quot;);
exampleDocRepository.save(exampleDoc);
</code></pre>
<p>The persistence constructor is used for the reverse - extracting a document from db and converting it to java object, e.g.</p>
<pre><code>ExampleDoc exampleDoc = exampleDocRepository.findById(objectId)
</code></pre>
<p>Since the persistence constructor takes all arguments, I'd like to use lombok's @AllArgsConstructor annotation to avoid having to add this explicitly.</p>
<p>I tried using:</p>
<pre><code>@ToString
@Document
@AllArgsConstructor
public class ExampleDoc {

    @PersistenceConstructor

    @Id
    @Getter @Setter @NonNull private ObjectId id;
    @Indexed(unique = true)
    @Getter @Setter @NonNull private String uniqueField;
    @Getter @Setter String field1
    @Getter @Setter String field2
}
</code></pre>
<p>but this did not work. Is there a way to combine the 2 so I don't have to explicitly create a constructor that lists all fields?</p>

