<p>1). check to see if the bookId is existing (this bookId is coming for the google books api stored in the book module).</p>
<p>2). if the book is not already in the database then save it.</p>
<p>3). add the id (mongoose.Types.ObjectId) to the User (module) in the 'books' field array.</p>
