checkOutTime:&lt;Date&gt;
checkInTime:&lt;Date&gt;
</code></pre>
<p>The next step is to use <code>$lookup</code> stage to get car location between the two timestamps (<em>checkOutTime</em> and <em>checkInTime</em>). Every car geolocation document has <em>carID</em> and <em>geoLocationTimestamp</em> fields. If I use static dates, for example as such:</p>
<pre class="lang-js prettyprint-override"><code>{
  from: 'carGeoLocations',
  localField: 'carID',
  foreignField: 'carID',
  pipeline: [
    {$match: {
      geoLocationTimestamp: {
        $gte: ISODate('2022-01-01T00:00:00.000+0000'), 
        $lte: ISODate('2023-01-01T00:00:00.000+0000')
      }
    }}
  ],
  as: 'coordinates'
}
</code></pre>
<p>I do get geolocations between 1. 1. 2022 and 1. 1. 2023. Mongo Playground with an example of this behaviour can be accessed <a href="https://mongoplayground.net/p/pZqi2vmoE8S" rel="nofollow noreferrer">here</a>.
However, if I try to use dynamic dates based on values of <em>checkOutTime</em> and <em>checkInTime</em>, no documents are retrieved. Mongo playground with this example is available <a href="https://mongoplayground.net/p/NrWyrBVmOf-" rel="nofollow noreferrer">here</a>. I've tried the following:</p>
<pre class="lang-js prettyprint-override"><code>{
 from: 'carGeoLocations',
 localField: 'carID',
 foreignField: 'carID',
 pipeline: [
   {$match: {
     geoLocationTimestamp: {
       $gte: &quot;$checkOutTime&quot;, 
       $lte: &quot;$checkInTime&quot;
     }
   }}
 ],
 as: 'coordinates'
}
</code></pre>
<p>and</p>
