 pipeline: [
   {$match: {
     geoLocationTimestamp: {
       $gte: '$$t1', 
       $lte: '$$t2'
     }
   }}
 ],
 as: 'coordinates'
}
</code></pre>
<p>With the same results. Can anyone spot any issues with my approach?</p>

