MongoDB - How to update a specific property of a nested array element<p>I have a collection with the following structure:</p>
<pre><code>{
  arrangements: [
    { displayName: &quot;MRT.8&quot; },
    { displayName: &quot;MRT.10&quot; },
    { displayName: &quot;MRT.12&quot; },
    (...)
  ]
}
</code></pre>
<p>I want the substring <code>MRT</code> to be replaced with <code>MOBILE</code>, so the result will be as follows:</p>
<pre><code>{
  arrangements: [
    { displayName: &quot;MOBILE.8&quot; },
    { displayName: &quot;MOBILE.10&quot; },
    { displayName: &quot;MOBILE.12&quot; },
    (...)
  ]
}
</code></pre>
<p>Following <a href="https://stackoverflow.com/questions/12589792/how-to-replace-substring-in-mongodb-document">the solution for a similar problem on SO</a> I did the following:</p>
<pre class="lang-js prettyprint-override"><code>db.collection('releaseDocument').updateMany({&quot;arrangements.displayName&quot;: {$regex: /MRT\..*/}}, [
      {
        $set: {
          'arrangements.displayName': {
            $concat: [
              &quot;MOBILE.&quot;,
              {$arrayElemAt: [{$split: [&quot;$displayName&quot;, &quot;MRT.&quot;]}, 0]}
            ]
          }
        }
      }
    ])
</code></pre>
<p>But that doesn't work because <code>$</code> refers to the current document, not the nested array element. How can I achieve what I described above?</p>

